Si 2014 a été l’année de la révélation avec en prime l’obtention du statut de User Group, l’année 2015 se présentait surtout comme celle de l’établissement pour Wikimedia Côte d’Ivoire. Le challenge principal en était la mise en place d’un cadre structurel devant servir au déploiement d’une organisation forte et dynamique au service des missions de promotion et de la libre diffusion du savoir et de la connaissance en Côte d’Ivoire et dans le monde.
